import React, { Component } from 'react'
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      position : 'main',
      loading : true,
      person : null
    }
  }

  async componentDidMount() {
    const url = "http://localhost:8000/users";
    const response = fetch(url);
    const data = (await response).json();

    this.setState({loading : false , person : data});
    console.log(data.pesult);
  }

  render() {
    return (
      <div className = 'App'>
        <nav>
            <div>
                <h1>Welcome to crud App</h1>
                {
                    this.state.position === 'main' ?
                    <div>
                        <p className = 'to-the-left'>Check all User</p>
                    </div>
                    :
                    <div>
                        <p className = 'to-the-left'> Back to Main Page</p>
                    </div>

                }
            </div>
        </nav>
        <div>
          {
            this.state.position === 'main' ? 
            <div className = 'content'>
              <form >
                <label for="fname">Full Name</label>
                <input type="text" id="fname" name="firstname" placeholder="Your Full Name.." />

                <label for="lname">Email</label>
                <input type="text" id="lname" name="lastname" placeholder="Your Email.." />


                <label for="fname">Age</label>

                <input type="text" id="fname" name="firstname" placeholder="Your Age.." />

                <input type="submit" value="Submit" />

              </form>

            </div>
            :
            <h1>Abhi poora kr rhe</h1>
          }

        </div>



      </div>
    )
  }
}

export default App;
